        <div id="sliderEl">
            <img className="slide" src={image}></img>
            {/* <div id="parag"> */}
            <h2>{h2}</h2>
            <p id="slider-p">
                {p2}
            </p>
            {/* </div> */}
        </div>
    )
}


export default Slide;
